import React from 'react'
import { StyleSheet, Text, View } from 'react-native'

const TrackItem = (props)=> {



    return (
        <View>
            <Text>{props.item.kind}</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    container:{
        width:'100%',
    },
});

export default TrackItem
